document.getElementById('btn').addEventListener("click", generoChart);
//document.getElementById('btn2').addEventListener("click", asistenciaPersona);
document.getElementById('fechaInicial').addEventListener("change",inicial);
document.getElementById('fechaFinal').addEventListener("change",valida);
document.getElementById('cmd').addEventListener("click", downloadPDF2);

function inicial(){
    var fi = document.getElementById("fechaInicial").value;
    if(fi!=""){
        document.getElementById("fechaFinal").disabled= false;
    }
}

function valida() {
    var fi = document.getElementById("fechaInicial").value;
    var ff = document.getElementById("fechaFinal").value;
    if(fi>ff){
        document.getElementById("btn").disabled= true;
        document.getElementById("fechaFinal").disabled= true;
        swal({
            title: "Error!",
            text: "La fecha inicial es mayor que la fecha final!",
            type: "error",
            confirmButtonText: "Entendido",
        });
        document.getElementById("fechaInicial").valueAsDate = null;
        document.getElementById("fechaFinal").valueAsDate = null;
    }
    else{
        document.getElementById("btn").disabled= false;
    }
}

function generoChart(){
    var ruta = '/informes/get_genero';
    var defaultData = [];
    var labels = [];
    var fechaInicial = $("#fechaInicial").val();
    var fechaFinal = $("#fechaFinal").val();
    if (fechaInicial > fechaFinal){
        document.getElementById("btn").disabled= true;
        document.getElementById("fechaFinal").disabled= true;
        swal({
            title: "Error!",
            text: "La fecha inicial es mayor que la fecha final!",
            type: "error",
            confirmButtonText: "Entendido",
        });
        document.getElementById("fechaInicial").valueAsDate = null;
        document.getElementById("fechaFinal").valueAsDate = null;
    }else{
        $.ajax({
            method: "GET",
            url: ruta,
            data : {'fechaInicial':fechaInicial,'fechaFinal':fechaFinal},
            success: function(data){
                labels = data.labels;
                defaultData = data.default;
                total = data.total;
                limite = data.limite;
                inferior = data.inferior;
                setChart();
            },
            error: function(error_data){
                console.log("error")
                console.log(error_data)
            }
        })
        chartColors = {
            red: 'rgb(255, 99, 132)',
            orange: 'rgb(255, 159, 64)',
            yellow: 'rgb(255, 205, 86)',
            green: 'rgb(75, 192, 192)',
            blue: 'rgb(54, 162, 235)',
            purple: 'rgb(153, 102, 255)',
            grey: 'rgb(201, 203, 207)'
        };
        Chart.plugins.register({
            afterDatasetsDraw: function(chart, easing) {
                var ctx = chart.ctx;
                chart.data.datasets.forEach(function (dataset, i) {
                    var meta = chart.getDatasetMeta(i);
                    if (!meta.hidden) {
                        meta.data.forEach(function(element, index) {
                            ctx.fillStyle = 'rgb(0, 0, 0)';
                            var fontSize = 12;
                            var fontStyle = 'normal';
                            var fontFamily = 'Helvetica';
                            ctx.font = Chart.helpers.fontString(fontSize, fontStyle, fontFamily);
                            var dataString = dataset.data[index].toString();
                            ctx.textAlign = 'center';
                            ctx.textBaseline = 'middle';
                            var padding = -20;
                            var position = element.tooltipPosition();
                            ctx.fillText(dataString, position.x, position.y - (fontSize / 2) - padding);
                        });
                    }
                });
            }
        });
        function setChart(){
            var ctx = document.getElementById("chart-area");
            var myChart = new Chart(ctx, {
                type: 'bar',
                data: {
                    labels: labels,
                    datasets: [{
                        data: defaultData,
                        backgroundColor: [
                            chartColors.red,
                            chartColors.blue,
                        ],
                    }],
                },
                options: {
                    responsive: true,
                    legend:{
                        display: false,
                    },
                    title: {
                        display: true,
                        text: 'Asistencia de personas por sexo'+" ("+total+" persona) desde "+fechaInicial+" hasta "+fechaFinal,
                        fontSize: 16,
                    },
                    scales: {
                        xAxes: [{
                                display: true,
                                scaleLabel: {
                                    display: true,
                                }
                            }],
                        yAxes: [{
                                display: true,
                                ticks: {
                                    stepValue: 10,
                                    max: limite+10,
                                    min: inferior-10, 
                                }
                            }]
                    },
                },
            });
            document.getElementById('fijaTabla').style.display = 'block';
        }
    }
}

function downloadPDF2() {
    var newCanvas = document.querySelector('#chart-area');
    var newCanvasImg = newCanvas.toDataURL("image/png", 1.0);
    //creates PDF from img
    var doc = new jsPDF('l', 'mm', [220, 280]);
    var logo = new Image();
    logo.src = "data:image/png;base64,";
    doc.addImage(logo, 'PNG', 10, 10, 20, 20);
    doc.setFont("helvetica");
    doc.setTextColor(100);
    doc.setFontType("bold");
    doc.setFontSize(20);
    doc.text(32, 15, "Punto Vive Digital Lab Girardot");
    doc.setFontSize(16);
    doc.text(32, 22, "Control de asistencia y servicios");
    doc.text(32, 29, "Uso de servicios por Sexo");
    doc.addImage(newCanvasImg, 'PNG', 10, 40, 260, 140 );
    doc.save('ServiciosXSexo.pdf');
}
